// Code here will run only once, no matter how many input items there are.
// More info and help: https://docs.n8n.io/nodes/n8n-nodes-base.function
// Tip: You can use luxon for dates and $jmespath for querying JSON structures

const current = [];
for(let i = 0; i < items[0].json.length; i++) {
  if(items[0].json[i].Status === "Завершена" || items[0].json[i].Status === "Отменена") {
    continue;
  }
  current.push({
    id: items[0].json[i].id,
    user: items[0].json[i].fullname,
    creator: items[0].json[i].creator,
    group: items[0].json[i].gfullname,
    timestamp: items[0].json[i].timestamp,
    name: items[0].json[i].Name,
    status: items[0].json[i].Status,
    executor: items[0].json[i].mfullname,
    priority: items[0].json[i].Priority === "Высокий" ? 5 : 3,
    link: `https://help.knp24.ru/request/${items[0].json[i].id}`
  })
}

let updates = [];
const staticData = getWorkflowStaticData('node');

if(!staticData.lastExecution || ! (staticData.lastExecution instanceof Array)) {
  updates = JSON.parse(JSON.stringify(current));
  updates.forEach(request => {
    request.type = "new";
  });
 }
else {
  current.forEach(request => {
    const index = staticData.lastExecution.findIndex(element => request.id === element.id);
    if (request.status === "Открыта повторно") {
      if (index !== -1 && request.status === staticData.lastExecution[index].status) {
        return;
      }
      updates.push(JSON.parse(JSON.stringify(request)))
      updates[updates.length - 1].type = "reopened";
      return;
    }
    if (index === -1) {
      updates.push(JSON.parse(JSON.stringify(request)))
      updates[updates.length - 1].type = "new";
      return;
    }
    if (index !== -1 && request.status === "Просрочена реакция") {
      if (request.status === staticData.lastExecution[index].status) {
        return;
      }
      updates.push(JSON.parse(JSON.stringify(request)))
      updates[updates.length - 1].type = "reactionTimeout";
      return;
    }
    if (index !== -1 && request.status === "Просрочено исполнение") {
      if (request.status === staticData.lastExecution[index].status) {
        return;
      }
      updates.push(JSON.parse(JSON.stringify(request)))
      updates[updates.length - 1].type = "executionTimeout";
      return;
    }
  });
}
staticData.lastExecution = JSON.parse(JSON.stringify(current));
return updates;
